5)
тут критерий сумма лайков, сообщений и постов 

SELECT 
id,
(SELECT CONCAT(first_name, ' ', last_name)) AS full_name,
((SELECT posts
  FROM (SELECT Count(*) as posts, user_id from posts GROUP BY user_id) AS p_a
  WHERE user_id = users.id) +
(SELECT messages
  FROM (SELECT Count(*) as messages, from_user_id from messages GROUP BY from_user_id) AS m_a
  WHERE from_user_id = users.id) +
(SELECT likes
  FROM (SELECT Count(*) as likes, user_id from likes GROUP BY user_id) AS l_a
  WHERE user_id = users.id)) as activity
FROM users
ORDER BY activity
LIMIT 10;

